import styles from "./style.css";

const Dashboard = () => {
	const handleLogout = () => {
		localStorage.removeItem("token");
		window.location.reload();
	};

	return (
		<div className={styles.main_container}>
	<h1>Dashboard</h1>
		</div>
	);
};

export default Dashboard;
